import React, {setState} from 'react';
import Link from 'next/link';
import Router from 'next/router';
import {getUserInformation} from '../services/api';

class Dashboard extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            user: {}
        };
        this.logOut = this.logOut.bind(this);
        this.fetchUserData = this.fetchUserData.bind(this);
    };

    logOut = () => {
        localStorage.removeItem('token');
        Router.push('/')
        return;
    };

    fetchUserData = async () => {
        const resp = await getUserInformation();
        if (resp) {
            if (resp.status === 200) {
                return resp.data.user; 
            }
        }
    };

    componentDidMount = async () => {
        const userData = await this.fetchUserData();
        this.setState({
            user: {
                email: userData.email,
                id: userData.id,
                nickname: userData.nickname,
                username: userData.username,
                pfp_url: userData.profile_photo_url
            }
        });
    };


    render() {
        return (
            <div>
                {/* pass this.state.user props to navbar */}
                <h4>M E T A _ IDentity Services Platform</h4>
                <h3>Hello {this.state.user.nickname}!</h3>
                <span>{this.state.user.email}</span>
                You are logged in. This will be your dashboard.
                <button onClick={() => fetchUserData()}>View user data.</button>
                <button onClick={() => logOut()}>
                    Logout
                </button>
            </div> 
        )
    }
}

export default Dashboard;
